import React, {useState, useEffect} from "react";
import './App.css';

const UserProfiles = () => {

  const fetchUserProfiles = () => {
      fetch("http://localhost:8080/api/v1/user-profile")
          .then(res => {
              console.log(res);
          });
  }

  useEffect(() => fetchUserProfiles(), [] );

  return <h1>Hello</h1>
}
function App() {
  return (
    <div className="App">
        <UserProfiles/>
    </div>
  );
}

export default App;
